'use client'
import { useState, useRef } from 'react'
import { Button } from '@/components/ui/Button'

const dummyPlayers = [
  { id: '1', name: 'Nguyen Van A' },
  { id: '2', name: 'Tran Thi B' },
  { id: '3', name: 'Le Van C' }
]

export default function FaceDetection() {
  const [apiData, setApiData] = useState(null)
  const [selectedFace, setSelectedFace] = useState(null)
  const [registeredPlayers, setRegisteredPlayers] = useState([])
  const imgRef = useRef(null)

  // Mock API call - thay bằng API thực tế của bạn
  const fetchFaceData = async () => {
    const mockApiResponse = {
      status: "Success",
      message: "Nhận diện khuôn mặt thành công!",
      data: {
        detectedFaces: [
          {
            username: "Không xác định",
            userId: "Không xác định",
            faceId: "face1",
            confidence: 0,
            boundingBox: {
              width: 0.186,
              height: 0.313,
              left: 0.086,
              top: 0.369
            }
          },
          {
            username: "Không xác định",
            userId: "Không xác định",
            faceId: "face2",
            confidence: 0,
            boundingBox: {
              width: 0.174,
              height: 0.290,
              left: 0.794,
              top: 0.349
            }
          },
          {
            username: "hieptv3",
            userId: "550e8400-e29b-41d4-a716-556655440002",
            faceId: "face3",
            confidence: 99.79,
            boundingBox: {
              width: 0.093,
              height: 0.159,
              left: 0.559,
              top: 0.453
            }
          }
        ],
        originalImageUrl: "data:image/jpeg;base64," // Base64 image
      }
    }
    setApiData(mockApiResponse)
  }

  const handleRegister = (faceId, playerId) => {
    const player = dummyPlayers.find(p => p.id === playerId)
    const face = apiData.data.detectedFaces.find(f => f.faceId === faceId)
    
    setRegisteredPlayers([...registeredPlayers, {
      ...player,
      faceId: face.faceId,
      boundingBox: face.boundingBox
    }])
    setSelectedFace(null)
  }

  const handleRemovePlayer = (faceId) => {
    setRegisteredPlayers(registeredPlayers.filter(p => p.faceId !== faceId))
  }

  // Lấy danh sách player chưa đăng ký
  const getUnregisteredPlayers = () => {
    return dummyPlayers.filter(
      p => !registeredPlayers.some(rp => rp.id === p.id)
    )
  }

  return (
    <div className="p-4">
      <Button onClick={fetchFaceData}>Tải dữ liệu nhận diện</Button>

      {apiData?.data?.originalImageUrl && (
        <div className="relative mt-4 inline-block">
          <img 
            ref={imgRef} 
            src={apiData.data.originalImageUrl} 
            alt="Detected faces" 
            className="max-w-full rounded-lg shadow-lg"
          />

          {/* Vẽ các bounding box */}
          {apiData.data.detectedFaces.map((face) => {
            const isRegistered = face.userId !== "Không xác định" || 
                              registeredPlayers.some(rp => rp.faceId === face.faceId)
            const playerName = isRegistered 
              ? registeredPlayers.find(rp => rp.faceId === face.faceId)?.name || face.username
              : "Chưa xác định"

            return (
              <div key={face.faceId}>
                {/* Bounding box */}
                <div
                  className={`absolute border-2 cursor-pointer ${isRegistered ? 'border-green-500' : 'border-red-500'}`}
                  style={{
                    left: `${face.boundingBox.left * 100}%`,
                    top: `${face.boundingBox.top * 100}%`,
                    width: `${face.boundingBox.width * 100}%`,
                    height: `${face.boundingBox.height * 100}%`
                  }}
                  onClick={() => !isRegistered && setSelectedFace(face)}
                />

                {/* Hiển thị tên */}
                <div
                  className={`absolute ${isRegistered ? 'bg-green-100 text-green-800' : 'bg-red-100 text-red-800'} px-2 py-1 rounded text-sm`}
                  style={{
                    left: `${face.boundingBox.left * 100}%`,
                    top: `${(face.boundingBox.top + face.boundingBox.height) * 100}%`,
                    transform: 'translateY(0.25rem)'
                  }}
                >
                  {playerName}
                  {isRegistered && (
                    <button 
                      onClick={(e) => {
                        e.stopPropagation()
                        handleRemovePlayer(face.faceId)
                      }}
                      className="ml-2 text-xs"
                    >
                      ✕
                    </button>
                  )}
                </div>
              </div>
            )
          })}
        </div>
      )}

      {/* Dialog chọn player */}
      {selectedFace && (
        <div className="fixed inset-0 bg-black/50 flex items-center justify-center z-50">
          <div className="bg-white p-4 rounded-lg w-80 max-w-full">
            <h3 className="font-bold text-lg mb-2">Chọn người chơi</h3>
            <div className="max-h-60 overflow-y-auto">
              {getUnregisteredPlayers().map(player => (
                <div
                  key={player.id}
                  className="p-2 hover:bg-gray-100 cursor-pointer rounded"
                  onClick={() => handleRegister(selectedFace.faceId, player.id)}
                >
                  {player.name}
                </div>
              ))}
            </div>
            <Button 
              variant="outline" 
              className="mt-4 w-full"
              onClick={() => setSelectedFace(null)}
            >
              Đóng
            </Button>
          </div>
        </div>
      )}
    </div>
  )
}